import React, { Component } from "react";
import { Button } from "react-bootstrap";

class ShoppingCart extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    shoppedItem = this.props.shoppedItem;
    return (
      <div>
        {shoppedItem.map((product, id) => {
          return (
            <div key={id}>
              <div>Name:{this.shoppedItem.name}</div>
              <div>Price:{this.shoppedItem.price}</div>
              <div>Quantity:{this.shoppedItem.quantity}</div>
            </div>
          );
        })}
      </div>
    );
  }
}

export default ShoppingCart;
